@notice Settle the current Lil Nouns auction, mint the next noun, and start
the next auction if possible.
@param invalidAfter is the largest blocknumber the transaction will be
considered valid. If the block.number is greater invalidAfter when the
transaction is processed, it will immediately revert, and not attempt to
settle the current auction.

@notice Fetch the current auction state and calculate the svg image of
the next noun if it were minted in thecurrent block
@dev This function allows for the calculation of the svg in a single eth_call
@return current block.number, the next nounId, the next Lil Noun's svg,
and the current auction state

@title LilNounsOracle
@author nvonpentz
@notice LilNounsOracle serves two purposes - (1) it creates a single
endpoint for retrieving the current Lil Noun auction state and the image of
the next noun, and (2), exposes a function for starting nouns auctions with
the guarantee that the expected noun will be minted.
